import React, { Component } from "react";
import { Button,Dropdown,DropdownButton,ButtonGroup} from "react-bootstrap";
import SearchBarwithShowVDS from "./SearchBarwithShowVDS";
export default class showVideos extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: this.props,
        };
    }
    render() {
        return (
            <div className="tmShowvideos">

                <SearchBarwithShowVDS />
                <hr />  
                <div class="card" style="width: 18rem;">
  <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <h6 class="card-subtitle mb-2 text-muted">Card subtitle</h6>
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" class="card-link">Card link</a>
    <a href="#" class="card-link">Another link</a>
  </div>
</div>
                <div className="tmShowvideos leftmargin videoHW ">
                    <div class="embed-responsive embed-responsive-16by9">
                        <iframe
                            class="embed-responsive-item"
                            src="https://www.youtube.com/embed/zpOULjyy-n8?rel=0"
                            allowfullscreen
                        >
                        </iframe>
                    </div>
                    <div>
                        {/* <button type="button" class="btn btn-outline-success rounded-0">Download</button> */}
                        <div className="mb-2">
    {['up'].map((direction) => (
      <DropdownButton
        as={ButtonGroup}
        key={direction}
        id={`dropdown-button-drop-${direction}`}
        drop={direction}
        variant="outline-success"
        title={` Download`}
      >
       <Dropdown.Header><b>Select Format</b></Dropdown.Header>
         <Dropdown.Divider />
         <Dropdown.Item href="#/action-1">MP3</Dropdown.Item>
    <Dropdown.Item href="#/action-2">MP4</Dropdown.Item>
    <Dropdown.Item href="#/action-3">HD</Dropdown.Item>
      </DropdownButton>
    ))}
  </div>
                    </div>
                </div>

            </div>
        );
    }
}
